syntax = "proto2";

package earth.document;

option java_multiple_files = true;
option optimize_for = CODE_SIZE;
option java_package = "com.google.android.apps.earth.document";

enum Icon {
    ICON_UNKNOWN = 0;
    ICON_MAP = 1;
    ICON_NETWORK_LINK = 2;
    ICON_DEFAULT_DOCUMENT = 3;
}
